                {console.log(props.families)}
                {props.families.map((family, index) => 
                    <li>
                        <a href={`/families/${index}`}><strong>{family.name}</strong></a>
                        
                        </li>
               

                    )}
            </ul>
        </div>
    )
}
export default Index;

